function addToLog(addNode,limit,resetLog,sort) {
	limit = limit || 300;
	resetLog = resetLog || false;
	sort = sort || false;
	addToLog.backgroundColor = (!addToLog.backgroundColor) ? "#F5F5DC" : (addToLog.backgroundColor=="#F5F5DC") ? "#EEE8CD" : "#F5F5DC";
	if (resetLog) { $("#JRStatusContainer").html(""); return true; }
	if (limit) {
		var logLength = $("#JRStatusContainer").find(".logDiv").length;
		if (logLength > limit) $("#JRStatusContainer").find(".logDiv:last").remove();
	}
    var firstLogDiv = $("#JRStatusContainer").find(".logDiv:first");
	var newLogDiv =createDiv().css({"textIndent":"10px","color":"#B22222","backgroundColor":"#FFFFFF"})
		.animate({"color":"#000000","backgroundColor":addToLog.backgroundColor},30000).attr("class","logDiv").append(addNode);
    if (firstLogDiv.length) firstLogDiv.before(newLogDiv);
    else $("#JRStatusContainer").append(newLogDiv);
	return true;
}
function errorRequest(res,theNumber) {
    console.log("error: " + res.statusText);
    if (res.statusText == "Forbidden") processResults( theNumber, "LOGGEDOFF" );
}
function requestUrl(theUrl, theNumber, theFunction, errorFunction, data1, data2, theResponseType) {
    var theResponseType = theResponseType || "";
    GM_xmlhttpRequest({
        method: "GET",
        url: theUrl,
        responseType: theResponseType,
        onload: function(response) { if (typeof theFunction == 'function') theFunction(response,theNumber,data1,data2); },
        onerror: function(response) { if (typeof errorFunction == 'function') errorFunction(response,theNumber); }
    });
}
function processResults( theNumber, result ) {
    switch(result) {
        case "NOACCEPT":
			gMissed = gMissed+1;
			$("#JRControlsContainer .JRMissedNumber:first").html(gMissed);
        case "NOMORE":
        case "PREVIEWPAGE":
			if (gNoPRECounter!=-1) gNoPRECounter++;
            break;
        case "TOOFAST":
			gNoPRECounter = 0;
            theCycler.cycleIncrease(10);
			gSlowingNumber = theCycler.cycleSkipping();
			$("#JRControlsContainer .JRSlowingMS:first").html(gSlowingNumber + "ms");
            break;
        case "LOGGEDOFF":
			theCycler.pause();
			playThisSound("pausing");
			showAlertDialog("You are logged Off!","400","180",
				createSpan("You are logged off from Mturk.com.<br>Press the link below to log back in.<br>")
				.append(createDiv(createLink("Go to Mturk Page","https://www.mturk.com/mturk/myhits","_blank","https://www.mturk.com/mturk/myhits")
					.click( function() { 
						window.open("https://www.mturk.com/mturk/myhits","_blank","width=" + 1000 + ",height=" +  800 + ",scrollbars=yes,toolbar=yes,menubar=yes,location=yes");
						return false;
					})).css({"color":"blue","margin-top":"15px"})
				), function() {
					theCycler.unpause();
				}
			);
            break;
		case "CAPTCHADETECTED":
			theCycler.pause();
			playThisSound("pausing");
			var thisPandaUrl = pandaLink(gGroupIDNumber);
			showAlertDialog("Detected a Captcha!","400","180",
				createSpan("Found a captcha so now pausing<br>Click link below to fill it in.<br>")
				.append(createDiv(createLink("Go to Mturk Page",thisPandaUrl,"_blank",thisPandaUrl)
					.click( function() { 
						window.open(thisPandaUrl,"_blank","width=" + 1000 + ",height=" +  800 + ",scrollbars=yes,toolbar=yes,menubar=yes,location=yes");
						return false;
					})).css({"color":"blue","margin-top":"15px"})
				), function() {
					theCycler.unpause();
				}
			);
			break;
        case "DAILYLIMIT":
            break;
        case "QUEUEMAX":
			if (gQueueMaxCount!=0) {
				theCycler.removeJob(10);
				theCycler.addJob( function( elapsed, theNumber ) {
					requestUrl("https://www.mturk.com/mturk/sortmyhits?searchSpec=HITSearch%23T%231%2310%23-1%23T%23!Status!0!rO0ABXQACEFzc2lnbmVk!%23!Deadline!0!%23!&selectedSearchType=hitgroups&searchWords=&sortType=Deadline%3A0&pageSize=25",1,function(theResult,theNumber,data1,data2) {
						return parseQueuePage(theResult);
					},function() { errorRequest(); } );
					return true;
				}, -1, 4000); // every 4 seconds
				if (gQueueMaxCount==-1) playThisSound("fullqueue");
				gQueueMaxCount = 0;
			} else if (gQueueMaxCount>0) {
				gQueueMaxCount = 1;
			}
            break;
        case "ACCEPTED":
			if (gNoPRECounter!=-1) gNoPRECounter++;
			if (gQueueMaxCount>0) gQueueMaxCount++;
			gAccepted = gAccepted+1;
			$("#JRControlsContainer .JRAcceptedNumber:first").html(gAccepted);
			playThisSound("collected");
            break;
    }
	if (gQueueMaxCount>5) gQueueMaxCount=-1;
	if (gNoPRECounter!=-1) {
		if (gNoPRECounter>75) { theCycler.cycleDecrease(10); gNoPRECounter = 0; }
		gSlowingNumber = theCycler.cycleSkipping();
		if (gSlowingNumber===0) gNoPRECounter=-1;
		$("#JRControlsContainer .JRSlowingMS:first").html(gSlowingNumber + "ms");
	}
}
function parseQueuePage(theResult,theNumber) {
    var parser = new DOMParser();
    var xmlDoc = parser.parseFromString(theResult.responseText,"text/html");
    var errorTitle = xmlDoc.getElementsByClassName("error_title")[0];
	if (errorTitle) {
        var errorTitleHTML = errorTitle.innerHTML; 
		if ( errorTitleHTML.indexOf("There are currently no HITs") != -1 ||
			errorTitleHTML.indexOf("You do not currently have any HITs") != -1) { 
				gHitsInQueue = 0;
		} else if ( errorTitleHTML.indexOf("You have exceeded the maximum allowed page request rate") != -1 ) {
			return;
		}
	} else {
		var titleOrangeText = xmlDoc.getElementsByClassName("title_orange_text")[0];
		var thisKey = "";
		if (titleOrangeText) {
			var words = titleOrangeText.innerHTML.trim().split(' ');
			if ($.isNumeric(words[words.length - 2])) gHitsInQueue = parseInt(words[words.length - 2]);
			if (gHitsInQueue<25) {
				theCycler.removeJob(-1);
				collectNow($("#JRCollectB"));
				gQueueMaxCount=1;
			}
		}
    }
}
function parseMturkHitPage(theResult,theNumber) {
    var parser = new DOMParser();
    var xmlDoc = parser.parseFromString(theResult.responseText,"text/html");
    var dailyLimit = false;
    var errorTitle = xmlDoc.getElementsByClassName("error_title")[0];
    if (errorTitle && errorTitle.innerHTML.indexOf("You have exceeded the maximum allowed page request") != -1) {  processResults( theNumber, "TOOFAST" ); return; }
    var loggedOff1 = xmlDoc.getElementById("ap_signin_custom_message");
    var loggedOff2 = xmlDoc.getElementById("lnkWorkerSignin");
    var loggedOff3 = xmlDoc.getElementById("signin-slot");
    if (loggedOff1 || loggedOff2 || loggedOff3) { processResults( theNumber, "LOGGEDOFF" ); return; }
    var alertBoxHeader = xmlDoc.getElementById("alertboxHeader");
    if (alertBoxHeader) {
        var alertHeaderHTML = alertBoxHeader.innerHTML;
        if (alertHeaderHTML.indexOf("There are no more available HITs") != -1 || alertHeaderHTML.indexOf("There are no HITs in this group") != -1) {
            processResults( theNumber, "NOMORE" ); return;
        } else if (alertHeaderHTML.indexOf("You have accepted the maximum number of HITs allowed") != -1) { processResults( theNumber, "QUEUEMAX" ); return;
        } else if (alertHeaderHTML.indexOf("The HIT you were viewing could not be accepted") != -1) {
			processResults( theNumber, "NOACCEPT" );
			return;
        } else if (alertHeaderHTML.indexOf("You are not qualified to accept") != -1 || alertHeaderHTML.indexOf("Your Qualifications do not meet the") != -1) {
            processResults( theNumber, "NOTQUALIFIED" ); return;
        }
        dailyLimit = (alertHeaderHTML.indexOf("There are no HITs available for you at this time") != -1);
    }
	if (xmlDoc.getElementsByName("userCaptchaResponse").length) { processResults( theNumber, "CAPTCHADETECTED" ); return; }
    var hitAccepted = $(xmlDoc).find("img[src$='/media/return_hit.gif']");
    var hitPreview = $(xmlDoc).find("input[src$='/media/accept_hit.gif']");
    if (errorTitle && errorTitle.innerHTML.indexOf("Your request was not completed successfully") != -1) {
        processResults( theNumber, "NOTCOMPLETED" );
    } else if (dailyLimit) {
        processResults( theNumber, "DAILYLIMIT" );
    } else if (hitAccepted.length) {
        var capsuleNode = $(xmlDoc).find("td.capsulelink_bold:first div").eq(0);
        var theTitle = (capsuleNode.length) ? $(capsuleNode).html().trim() : "Unknown";
        var timeLeft = $(xmlDoc).find("a#time_left\\.tooltip");
        var theDuration = (timeLeft.length) ? timeLeft.parent().next().html().trim() : "";
        var requesterTip = $(xmlDoc).find("#requester\\.tooltip");
        var requesterNameNode = (requesterTip.length) ? $(requesterTip).parent().next() : null;
        var theRequesterName = (requesterNameNode.length) ? ( ($(requesterNameNode).find("a").length) ? $(requesterNameNode).find("a").html().trim() : $(requesterNameNode).html().trim() ) : "";
        theRequesterName = (theRequesterName) ? theRequesterName : "Unknown";
        var numberHitsTip = $(xmlDoc).find("#number_of_hits\\.tooltip");
        var theNumberHits = (numberHitsTip.length) ? numberHitsTip.parent().next().html().trim() : "1";
        var rewardTip = $(xmlDoc).find("#reward\\.tooltip");
        var theReward = (rewardTip.length) ? rewardTip.parent().next().find("span").html().replace("$","").trim() : "?.??";
        var rightNow = new Date();
		addToLog(createSpan("Accepted: [" + theRequesterName + "] - " + theTitle + " :" + theDuration + ": (" + theReward + ") at " + formatAMPM("short",rightNow))
			.css({"font-size":"17px","line-height":"20px"}));
		processResults( theNumber, "ACCEPTED" );
    } else if (hitPreview.length) {
        var formData = {};
        formData.hitId = $(xmlDoc).find("input[name='hitId']").eq(0).val();
        formData.prevHitSubmitted = $(xmlDoc).find("input[name='prevHitSubmitted']").eq(0).val();
        formData.prevRequester = $(xmlDoc).find("input[name='prevRequester']").eq(0).val();
        formData.requesterId = $(xmlDoc).find("input[name='requesterId']").eq(0).val();
        formData.prevReward = $(xmlDoc).find("input[name='prevReward']").eq(0).val();
        formData.groupId = $(xmlDoc).find("input[name='groupId']").eq(0).val();
        formData.signature = $(xmlDoc).find("input[name='signature']").eq(0).val();
		gGoToUrl = acceptLink(formData);
        processResults( theNumber, "PREVIEWPAGE" );
    } else { processResults( theNumber, "ERROR" ); }
}
function disableButton(target) { $(target).data("status","disable"); $("#JRCollectB").html("Collecting Disabled");$(target).css({"color":"#8B0000","background-color":"#F0FFFF"});}
function turnOffButton(target) { $(target).data("status","off"); $("#JRCollectB").html("Start Collecting Now");$(target).css({"color":"#000000","background-color":"#FFFFF0"});}
function turnOnButton(target) { $(target).data("status","on"); $("#JRCollectB").html("Stop Collecting Now"); $(target).css({"color":"#FFFFFF","background-color":"#008000"});}
function stopNow(target) {
	turnOffButton(target);
	theCycler.removeJob(10);
}
function collectNow(target) {
	turnOnButton(target);
	theCycler.addJob(function( elapsed, theNumber ) {
		$("#JRControlsContainer .JRElapsedTime:first").html(elapsed + "ms");
		if (gGoToUrl==="") {
			if (gDoPantha) requestUrl(previewLink(gGroupIDNumber),10,parseMturkHitPage, errorRequest);
			else requestUrl(pandaLink(gGroupIDNumber),10,parseMturkHitPage, errorRequest);
		} else {
			requestUrl(gGoToUrl,10,parseMturkHitPage, errorRequest);
			gGoToUrl = "";
		}
	},10,0);
}
function parseGroupID(inputElement) {
	var theValue = $(inputElement).val();
	$("#JRControlsContainer .JRErrorStatus:first").html("");
	var parsedGroupID = "";
	if (theValue==="") { $("#JRControlsContainer .JRErrorStatus").html(" - Error: Please Enter a url or GroupID first."); }
	else if (theValue.indexOf("groupId=")!=-1) {
		parsedGroupID = theValue.split("groupId=")[1];
		if (parsedGroupID.indexOf("&")!=-1) parsedGroupID = parsedGroupID.split("&")[0];
	} else if (theValue.match(/^[a-z0-9]+$/i)) {
		parsedGroupID = theValue;
	} else { $("#JRControlsContainer .JRErrorStatus").html(" - Error: Wrong panda URL or Group ID number."); }
	if (parsedGroupID!=="") {
		gGroupIDNumber = parsedGroupID;
		turnOffButton($("#JRCollectB"));
		$("#JRControlsContainer .JRStatusUpdate").html("Group ID Loaded: " + parsedGroupID + " : Not Collecting");
	}
}
function startPanthaHits() {
	createAlertWindow("Alert","500","400");
	createDiv().attr({"id":"JRControlsContainer"}).css({"height":170,"width":"100%","background-color":"#F0FFFF","border":"2px solid black","padding":"4px 0","overflow":"auto"}).appendTo("body");
	createDiv().attr({"id":"JRStatusContainer"}).css({"height":window.innerHeight-200,"width":"100%","background-color":"#FDFDF0","border":"2px solid black","overflow":"auto"}).appendTo("body");
	createDiv("Welcome to Pantha Collector where your throttled Panda urls get changed to a Pantha process.").css({"margin-top":"8px","text-align":"center","font-size":"20px"}).appendTo("#JRControlsContainer");
	createDiv("Pantha is a short term for \"Preview ANd THen Accept\" which does not get throttled.").css({"margin-top":"3px","text-align":"center","font-size":"15px","line-height":"20px"}).appendTo("#JRControlsContainer");
	createDiv("Panda URL or GroupID: ").css({"text-align":"center","font-size":"13px","margin-top":"10px"})
		.append(createTextInput("").attr({"id":"JRInputGroupID"}).css({"width":"600px","font-size":"9px"})
			.keypress( function(e) { if ( e.which == 13 ) { parseGroupID($(e.target)); }}))
		.append(createSpanButton(function(e) { parseGroupID($("#JRInputGroupID")); },"OK","#F8F8FF","black","12px"))
		.append(createSpanButton(function(e) { $("#JRInputGroupID").val("").focus(); },"Clear","#F8F8FF","black","12px"))
		.appendTo("#JRControlsContainer");
	createDiv("Script Status: ").css({"text-align":"center","font-size":"15px","color":"#00688B","margin":"4px auto"})
		.append(createSpan("No Group ID loaded. Collecting Disabled.").attr({"class":"JRStatusUpdate"}).css({"color":"#8B008B","font-weight":"500"}))
		.append(createSpan().attr({"class":"JRErrorStatus"}).css({"color":"#8B0000","font-weight":"bolder"})).appendTo("#JRControlsContainer");
	createDiv().css({"text-align":"center","font-size":"15px","margin":"14px auto 5px auto"}).append(createSpanButton(function(e) {
			var buttonStatus = $(e.target).data("status");
			if (buttonStatus!="disable") {
				if (buttonStatus=="off") collectNow($("#JRCollectB")); else stopNow($("#JRCollectB"));
				buttonStatus = $(e.target).data("status");
				$("#JRControlsContainer .JRStatusUpdate").html("Group ID Loaded: " + gGroupIDNumber + " : " + ((buttonStatus=="off") ? "Not Collecting" : "Collecting Hits Now"));
			}
		},"Collecting Disabled","#D3D3D3","#808080","15px").data("status","disable").attr({"id":"JRCollectB"}))
		.append(createSpanButton(function(e) {
			theCycler.skippingReset();
			gNoPRECounter = -1;
			gSlowingNumber = theCycler.cycleSkipping();
			$("#JRControlsContainer .JRSlowingMS:first").html(gSlowingNumber + "ms");
		},"Reset Slowing","#FFFFF0","#000000","15px"))
		.append(createSpanButton(function(e) {
			gDoPantha = !gDoPantha;
			$(e.target).html( (gDoPantha) ? "Switch to Panda" : "Switch to PanTHa");
		},"Switch to Panda","#FFFFF0","#000000","15px"))
		.append(createSpan(" | Timer: " + gCycleNumber + "ms").attr({"class":"JRCycleTextNumber"}).css({"margin": "0 5px"}))
		.append(createSpanButton(function(e) {
			if ($(e.target).data("status")=="changed") {
				var inputEdit = createSpan().attr("class","JRCycleSpanNumber").append(createSpan(" | ")
					.append(createTextInput(gCycleNumber).attr("class","JRCycleInputNumber").css({"width":"40px"})).append(createSpan(" ms ")));
				$(".JRCycleTextNumber:first").replaceWith(inputEdit);
				$(".JRCycleInputNumber:first").select();
				$(e.target).html("OK").data("status","changing");
			} else {
				var theValue = parseInt($(".JRCycleInputNumber:first").val());
				if (theValue>500 && theValue<4000) {
					gCycleNumber = theValue;
					theCycler.cycleResetChange(gCycleNumber);
					var cycleNumberText = createSpan(" | Timer: " + gCycleNumber + "ms").attr({"class":"JRCycleTextNumber"}).css({"margin": "0 5px"});
					$(".JRCycleSpanNumber:first").replaceWith(cycleNumberText);
					$(e.target).html("Change").data("status","changed");
				} else {
					alert("The timer can not be below 500ms and not above 5000ms");
				}
			}
		},"Change","#FFFFF0","#000000","15px").data("status","changed"))
		.appendTo("#JRControlsContainer");
	createDiv().css({"text-align":"center","font-size":"15px","margin":"12px auto"})
		.append(createSpan("[ Elapsed: ")).append(createSpan("0").attr("class","JRElapsedTime"))
		.append(createSpan(" | Accepted: ")).append(createSpan("0").attr("class","JRAcceptedNumber"))
		.append(createSpan(" | Missed: ")).append(createSpan("0").attr("class","JRMissedNumber"))
		.append(createSpan(" | Slowing: ")).append(createSpan("0ms").attr("class","JRSlowingMS"))
		.append(createSpan(" ]")).appendTo("#JRControlsContainer");
}

